package leetCode

import org.scalatest.FunSuite

class LSWRCTest extends FunSuite {

  test("test sample data") {
    val result = new LSWRC().lengthOfLongestSubstring("abcabcbb")
    assert(result===3)

    val result1 = new LSWRC().lengthOfLongestSubstring("bbbbb")
    assert(result1 === 1)

    val result2 = new LSWRC().lengthOfLongestSubstring("hnwnkuewhsqmgbbuqcljjivswmdkqtbxixmvtrrbljptnsnfwzqfjmafadrrwsofsbcnuvqhffbsaqxwpqcac")
    assert(result2 === 12)

    val result3 = new LSWRC().lengthOfLongestSubstring("qopubjguxhxdipfzwswybgfylqvjzhar")
    assert(result3 === 12)
  }

